<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>express-jsdoc-swagger</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Swagger OpenAPI 3.x generator">
  <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <link
    rel="stylesheet"
    href="style.css"
    title="docsify-darklight-theme"
    type="text/css"
  />
  <script src="//unpkg.com/docsify-edit-on-github/index.js"></script>
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'express-jsdoc-swagger',
      repo: 'https://github.com/BRIKEV/express-jsdoc-swagger',
      coverpage: false,
      loadSidebar: true,
      ga: 'UA-170034126-1',
      plugins: [
        EditOnGithubPlugin.create(
          'https://github.com/BRIKEV/express-jsdoc-swagger-docs/edit/master/docs/',
          null,
          'Improve this Doc',
        ),
      ],
    }
  </script>
  <script src="//cdn.jsdelivr.net/npm/docsify/lib/docsify.min.js"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/ga.min.js"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/search.min.js"></script>
  <script
    src="//cdn.jsdelivr.net/npm/docsify-darklight-theme@latest/dist/index.min.js"
    type="text/javascript">
  </script>
</body>
</html>
